import React from 'react';
import './style.css';
import { helper } from '../helpers/common';
const GlobalCorona = (data, error) => {
	if (!helper.getPropsId(error) || helper.getPropsId(data)) {
		console.log(error);
	}
	console.log(data);
	return (
		<section className="global__corona">
			<div className="global__item">
				<p>-Moi nhiem: 111</p>
				<p>-Tong ca nhiem: 123123 </p>
			</div>
			<div className="global__item">
				<p>-Moi tu vong: 123123 </p>
				<p>-Tong ca tu vong: 123123 </p>
			</div>
			<div className="global__item">
				<p>-Moi khoi benh: 123123 </p>
				<p>-Tong ca khoi benh: 123123 </p>
			</div>
		</section>
	);
};
export default GlobalCorona;
